import React from "react";
import { ReactDOM } from "react";

class Human extends React.Component {
  // super(props)を定義してからでないとthis.state等でprops内の値を新規追加出来ない
  constructor(props) {
    super(props);
  }

  render() {
    return <h2>test</h2>;
  }
}
